(1, 'home', '<div class=\"body-title\">\r\n<h1>Laos: The Land of a Million Elephants</h1>\r\n</div>\r\n\r\n<div class=\"content\">\r\n<figure class=\"firstpicture\">\r\n<img class=\"home\" id=\"slideshow\" src=\"assets/images/laos4.jpg\" alt=\"Patuxay\">\r\n</figure>\r\n\r\n<p>\r\nCome explore an exotic nation that is off the beaten path and discover all it has to offer. If you \r\nparticularly enjoy nature, you will be amazed by the beautiful natural sites that is gaining popularity among tourists. \r\nBackpackers that travel to the region seem to leave the country out of their itinerary, preferring \r\ndestinations such as Vietnam and Thailand for their travels. However, tourism is the fastest growing industry in Laos, \r\nattracting travelers under its new slogan \"Simply beautiful.\" Anyone seeking a simple and laidback lifestyle will enjoy Laos\r\nbecause you live at your own pace. </p>\r\n\r\n\r\n\r\n\r\n<p>Sabaidee! Welcome to our website. Here you can find all you need to know about Laos. Whether you are planning a trip or just want to learn\r\nsomething new, this site has information beginning from the history of Laos all the way to different Laotian dishes. At the end of your visit\r\ntoday, kindly visit the \"Feedback\" section of the site to take a short survey.  \r\n\r\nSafe travels! \r\n</p>\r\n</div>', , '', '');
INSERT INTO `modularSite` (`id`, `page`, `content`, `image`, `AbsoluteLinkPicture`, `CSS_Internal`) VALUES
(2, 'history', '<div class=\"content\">\r\n\r\n<div class=\"img-right\">\r\n<figure>\r\n<img src=\"assets/images/laos6.jpg\" alt=\"Fa Ngum\">\r\n<figcaption>Fa Ngum Statue in Vientiane</figcaption>\r\n</figure>\r\n</div>\r\n\r\n<div class=\"body-title\">\r\n<h1>The Early Days of Laos</h1>\r\n</div>\r\n\r\n<p> \r\nThe history of Laos stretches back to 1353 when warlord Fa Ngum declared himself the king of Lan Xang, meaning \"Million Elephants\". \r\nThe kingdom was a Khmer vassal state until 1694 when a succession dispute split it into three regions: Luang Prabang in the north, Vientiane \r\nin the middle and Champasak in the south. Eventually, the kingdom agreed to Siamese protection in 1885. \r\n\r\nEast of the Mekong River, the area was taken from the Siam by the French who wanted a buffer state to protect Vietnam. In 1907, Laos was \r\nset up as a unified territory. In 1945, Japan briefly occupied Laos which triggered a conflict spanning over 30 years when the French wanted to \r\nreclaim its colony. Laos was granted its independence from France in 1953, but war continued between the communist Pathet Lao trying to overthrow \r\nthe French-leaning monarchy. \r\n</p>\r\n\r\n<div class=\"body-title\">\r\n<h1>The Rise of Communism</h1>\r\n</div>\r\n\r\n<p>\r\nIn 1950, Pro-Communist Prince Souphanouvong formed the organization \"Pathet Lao\", which means Land of the Lao. The country was divided with\r\nparts of the country ruled by the royalist government backed by the USA. The other parts were ruled by the pro-Communist Pathet Lao with assistance\r\nfrom their ally, the Viet Minh. In the 1960s, Laos was drawn into the Vietnam War when the USA bombed Pathet Lao territory but did not defeat \r\nthem. In 1975, the Royalists fled Laos after seeing South Vietnam and Cambodia fall to the communists leading Pathet Lao to take over the entire country. \r\nAfter the fall of Saigon in 1975, the communist Pathet Lao took over the capital city, Vientiane, and ended a six-century-old monarchy. \r\nCloser ties to Vietnam and socialization were replaced with a steady return to private enterprise, easing of foreign investment laws, and\r\nadmission into ASEAN in 1997.\r\n</p>\r\n\r\n<div class=\"body-title\">\r\n<h1>Where is Laos Today?</h1>\r\n</div>\r\n\r\n<p>\r\nLife in Laos has relatively stayed the same for hundred of years. Until now, things are starting to slowly change. In the mid-90s,\r\nthe government began its campaign to encourage tourism and declared in 1998 to be \"Visit Laos Year.\" Despite their efforts, there were still\r\nmore monks than tourists in the country. Today, Laos is still a poor country but is rapidly developing and poverty declining.\r\nTourism is the leading industry in the country and the number of tourists continue to rise each year. \r\n</p>\r\n\r\n</div>\r\n', NULL, 'https://', ''),
(3, 'regions', '<div class=\"content\">\r\n\r\n<div class=\"body-title\">\r\n<h1>Northern Laos</h1>\r\n</div>\r\n\r\n<div class=\"img-right\">\r\n<figure>\r\n<img src=\"assets/images/laos8.jpg\" alt=\"Luang Prabang View\">\r\n<figcaption>Birdseye view of Luang Prabang</figcaption>\r\n</figure>\r\n</div>\r\n\r\n<h2>Luang Prabang</h2>\r\n<p>\r\nThis small town encircled by mountains and greenery is called Luang Prabang, the former capital of Laos. In 1545, King Phothisarat moved\r\nthe administrative seat to Vientiane. The city was designated a UNESCO World Heritage city since 1995. This distinction was awarded because the city \r\nreflects the fusion of Lao and European architecture and the townscape is well preserved. \r\nWhile strolling around the city, you may notice that the buildings combines the traditional Lao wooden houses with some European architecture.\r\nThis influence goes back to when Laos was a French colony. It is a relatively small city with the Nam Khan and Mekong Rivers surrounding almost the \r\nentire city. You can find anything from former royal palaces to over 33 temples since the city remains the main center for Buddhist learning\r\nin Laos. Thanks to its geographical location, it can be considered an adventurer\'s paradise. There are waterfalls, mountain peaks, and rivers \r\nproviding endless opportunities to enjoy all Luang Prabang has to offer.\r\n</p>\r\n\r\n<div class=\"body-title\">\r\n<h1>Central Laos</h1>\r\n</div>\r\n\r\n<div class=\"img-left\">\r\n<figure>\r\n<img src=\"assets/images/laos9.jpg\" alt=\"Night Market\">\r\n<figcaption>Vientiane\'s night market</figcaption>\r\n</figure>\r\n</div>\r\n\r\n<h2>Vientiane</h2>\r\n<p>\r\nThe capital city, Vientiane, is located in this region. The city sits right on the border with Northern Thailand divided by the\r\nMekong River. It is known as one of the quietest capital cities in Southeast Asia. It is pronounced \"Wiang Jan\" and translates roughly to\r\nthe \"City of Sandalwood\". The city has a small-town atmosphere to it, and two days is enough to see sights around the city. There is a piece of history\r\naround every corner, from the several temples such as Pha That Loung to the popular Patuxai monument. If you prefer nightlife, there are several \r\nbars and pubs in the downtown area. One of the most memorable experiences is shopping at the \"talat\" or market. There is the morning market open \r\ndaily from 7AM-6PM. It is located inside the only mall in Laos. You can find street vendors that sell items from freshly baked baguettes to \r\ntraditional Laotian clothing. From 6PM to 11PM, the night market is open by the riverside. This market is aimed towards tourists, and you can find \r\nsouvenirs items such as Beer Lao t-shirts and Buddhist-inspired knickknacks. \r\n</p>\r\n\r\n<div class=\"img-right\">\r\n<figure>\r\n<img src=\"assets/images/laos10.jpg\" alt=\"Vang Vieng\">\r\n<figcaption>Overlooking Vang Vieng and Mount Phousi</figcaption>\r\n</figure>\r\n</div>\r\n\r\n<h2>Vang Vieng</h2>\r\n<p>\r\nAbout a 3 hour drive north of Vientiane, lies the beautiful riverside town of Vang Vieng. Known for its picturesque landscape and nightlife,\r\nthis town is a popular stop with backpackers. It is well known for tubing along the Mekong River, where you can float by restaurants and bars, \r\nreferred to as \"TV Bars\", that play re-runs of Friends and Family Guy episodes. The majority of the bars have been shut down by the government \r\ndue to \"dangerous excessive partying\" resulting in the death of 27 tourists. As of February 2016, there were just 2 bars still open. The town isn\'t\r\nall about partying - it offers a vast amount of outdoor activities as well. There are tour companies that offer cave visits, kayaking, ziplines, \r\nswimming in water falls, and dirt buggies. \r\n</p>\r\n\r\n<div class=\"body-title\">\r\n<h1>Southern Laos</h1>\r\n</div>\r\n\r\n<div class=\"img-left\">\r\n<figure>\r\n<img src=\"assets/images/laos7.jpg\" alt=\"Si Phan Don\">\r\n<figcaption>One of the many islands in Si Phan Don</figcaption>\r\n</figure>\r\n</div>\r\n\r\n<h2>Si Phan Don</h2>\r\n\r\n<p>\r\nWould you have ever guessed that Laos has islands? Get your sunglasses and sunblock ready because the next location is Si Phan Don! \r\nThe name literally means \"4 Thousand Islands\" in Laotian. While there are 4000 islands, only two of them are most visited: Don Dhet and Don Khong.\r\nThe rest are uninhabited due to their small size. Don Dhet is the most laid back island while Don Khong is the biggest and busiest island. You can find\r\nIrrawaddy dolphin and plenty of fish in the water surrounding the islands. The dolphins are best spotted from the south of the islands\r\nfrom December until May towards the end of the day. Boat tours are available as well. The islands are really secluded and there are only basic accommodations, so \r\ndon\'t expect phones or electricity! Locals are self-sufficient and rely on local produce such as rice, fish, coconut, and sugar cane. Clothing is made\r\nby their own weaving techniques. It really is an escape from the real world. \r\n</p>\r\n\r\n</div>', NULL, 'https://', ''),
(4, 'culture', '<div class=\"content\">\r\n\r\n<div class=\"img-right\">\r\n<figure>\r\n<img src=\"assets/images/laos13.jpg\" alt=\"Baci\">\r\n<figcaption>Pha Khuan</figcaption>\r\n</figure>\r\n</div>\r\n\r\n<div class=\"body-title\">\r\n<h1>Religion + Baci Ceremony</h1>\r\n</div>\r\n\r\n<p>\r\nThe majority of Laotians are Buddhists, this is evident by the Pha That Luang being the national symbol of the country. The Pha That Luang is a gilded\r\nstupa temple located in Vientiane. There is also some influences of animism as well. There is a traditional ceremony called \"baci\" that is held\r\nbefore significant events to bind the 32 guardian spirits to a person\'s body. Significant events can be a marriage, the birth of a child, \r\na serious illness, or before leaving on a long trip. The baci ceremony is simply held to bring good luck and fortune to the person. \r\n</p>\r\n\r\n\r\n<div class=\"body-title\">\r\n<h1>How is the baci ceremony celebrated?</h1>\r\n</div>\r\n\r\n<h2>Before The Ceremony</h2>\r\n\r\n<p>\r\nElderly women in the community prepare the \"Pha Khuan\" which is a marigold pyramid that contains yellow/white flowers, \r\nwhite cotton threads, small candles, cooked sticky rice, boiled eggs and little treats. There is also \"Maak Beng\" which is folded banana leaves where \r\nsmall candles tied onto a stick is placed into. The white cotton threads are cut around 10 inches long, enough to tie on a person\'s wrist, and\r\ntied onto sticks that are stuck into the Maak Beng. The Maak Beng is then placed onto a big round silver tray. Rice is put on the base of the tray \r\nto keep it stable and treats such as fruits and boiled eggs surround the Maak Beng. Finally, the finished Pha Khuan is placed on a white cloth\r\nin the center of the room for the ceremony. The dress code is modest - women should wear the traditional \"sinh\" and men should wear a collared shirt\r\nwith long sleeve pants.\r\n</p>\r\n\r\n<div class=\"img-left\">\r\n<figure>\r\n<img src=\"assets/images/laos12.jpg\" alt=\"Sinh\">\r\n<figcaption>Traditional Laotian sinh</figcaption>\r\n</figure>\r\n</div>\r\n\r\n<h2>During The Ceremony</h2>\r\n<p>\r\nThe baci is performed by an older male who is usually, or has been, a monk. Everyone sits on the floor facing the Pha Khuan while the person\r\nperforming the baci chants in an ancient Sanskrit language. While this is happening, everyone has their palms held together in a position that is \r\ncalled \"nop\". People that sit closer to the Pha Khuan may be holding the white strings from the Pha Khuan between their palms. Near the end of the \r\nceremony, people that sit in the front reach forward to touch the Pha Khuan. Those that can\'t reach it put their hand on the person in front of them\r\nto get some of the \"luck\". Finally, the white strings from the Pha Khuan are cut into small strips that are used to tie on people\'s wrists while \r\nwishing them well. In one hand, you hold onto a treat from the tray while the string is being tied. Afterwards, make sure you \"nop\" to \r\nshow appreciation. The strings should be worn for at least 3 days. There is usually a party held afterwards, with music and plenty of food. \r\nIt is expected that attendees stay for a little bit to socialize. \r\n</p>\r\n\r\n<div class=\"img-right\">\r\n<figure>\r\n<img src=\"assets/images/laos14.jpg\" alt=\"Lao New Year\">\r\n<figcaption>Locals and tourists watered during the festival</figcaption>\r\n</figure>\r\n</div>\r\n\r\n<div class=\"body-title\">\r\n<h1>Lao New Year</h1>\r\n</div>\r\n\r\n<p>\r\nLao New Year, or Bun Pi Mai, is celebrated annually in April and spans over three days. This occurs during the hot season and is a perfect time \r\nto visit the country. The festivities relate back to Buddhism and Animism with the belief that one\'s old spirit leaves this world, therefore\r\nmaking room for a new one. On the first day of Pi Mai, it is considered the last day of the old year. Lao people clean their houses and prepare \r\nwater, perfume, and flowers for the upcoming days. On the second day, it is considered a \"day of no day\" meaning it is not part of the old year\r\nor part of the new year. The third day is when Lao New Year officially starts, locals will go \"tak baht\" which means giving alms to monks, go to\r\nbaci ceremonies, and soak each other in water! That\'s right, no matter where you go people will dump buckets of water or spray you with their \r\nwater guns! \r\n</p>\r\n</div>', NULL, 'https://', ''),
(5, 'food', '<div class=\"content\">\r\n\r\n<div class=\"body-title\">\r\n<h1>Traditional Dishes</h1>\r\n</div>\r\n\r\n<div class=\"img-right\">\r\n<img src=\"assets/images/foods.jpg\" alt=\"Foods\">\r\n</div>\r\n\r\n<p>\r\nLaotian food is unique and most dishes are served with sticky rice. While the popularity of dishes vary by region, there are a few\r\ntraditional platters that are enjoyed by almost every Laotian. \r\nThese dishes include: \r\n</p>\r\n\r\n\r\n\r\n<ul>\r\n<li>Khao Niew: Sticky rice. Just roll it into a rice ball with your hand. It is a staple to eat sticky rice with your meal.</li>\r\n<li><b>Padaek</b>: A fermented fish sauce made from anchovies used in many Lao dishes. Smelly but delicious.</li>\r\n<li><b>Larb</b>: A salad made with minced meat flavored with fish sauce, lime juice, padaek, and fresh herbs. Typical meats used are beef, pork, duck, shrimp.</li>\r\n<li><b>Kow Piek</b>: A soup made with noodles or rice. Made with chicken broth and topped with different meats and herbs. </li>\r\n<li><b>Gang Nor Mai</b>: Shredded bamboo shoot soup. Made with lemongrass, fish sauce, chicken stock.</li> \r\n<li><b>Tam</b>: A salad made with vegetables, padaek, lime, and chili peppers. Typical vegetables are papaya, cucumber, green beans.</li>\r\n</ul>\r\n\r\n<h2>Essential Cooking Utensils</h2>\r\n<ul>\r\n<li><b>Tip Kow</b>: A bamboo made to store the sticky rice. </li>\r\n<li><b>Kha Tok</b>: A mini table made out of rattan used to serve dishes when eating in a group.</li>\r\n<li><b>Khok</b>: A mortar that is used for pounding food like Tam.</li>\r\n</ul>\r\n\r\n</div>', NULL, 'https://', ''),
(6, 'landmarks', '<div class=\"content\">\r\n\r\n<div class=\"img-right\">\r\n<figure>\r\n<img src=\"assets/images/laos20.jpg\" alt=\"Kuang Si Waterfalls\">\r\n<figcaption>View of Kuang Si Waterfalls</figcaption>\r\n</figure>\r\n</div>\r\n\r\n<div class=\"body-title\">\r\n<h1>Kuang Si Waterfalls</h1>\r\n</div>\r\n\r\n<p>Hidden inside the lush jungles of Luang Prabang is the Kuang Si Waterfalls. This landmark is extremely underrated\r\nbut is becoming overrun by tourists every year. The water is turquoise blue and clear making it a perfect place to\r\nrelax and take beautiful photos. The best spot to go is at the \"secret pool\" at the top of the waterfall\r\nwhich overlooks the entire jungle. Also, there are ropes from trees that let you swing into the water. As you leave,\r\nstop by the Tat Kuang Si Bear Rescue Center and admire the Asiatic Black Bears that have been rescued from \r\ndangerous conditions. The bears\' habitat include hammocks, pools, and play areas to keep them entertained.</p>\r\n\r\n\r\n<div class=\"img-left\">\r\n<figure>\r\n<img src=\"assets/images/laos21.jpg\" alt=\"Plain of Jars\">\r\n<figcaption>Plain of Jars</figcaption>\r\n</figure>\r\n</div>\r\n\r\n<div class=\"body-title\">\r\n<h1>Plain of Jars</h1>\r\n</div>\r\n\r\n<p>\r\nIf you want to see the Stonehenge\'s sister, you need to visit the Plain of Jars. Located in Xiangkhouang, these large\r\nstone jars are made from rock ranging 3 to 10 feet tall and weigh up to 14 tons. The origins of the jars are \r\nunknown but archaeologists believe it was used 1,000 to 2,000 years ago. Researches believe that it was used for\r\nfuneral urns or food storage. It is also home to thousands of unexploded bombs from The Secret War that are scattered \r\nin the area. Tourists can visit 3 different sites that have already been cleared of the bombs. You can find \r\ntourists sitting on top of the jars while taking photos. Site 1 is the most popular being closest to the city and \r\nhaving a small museum. Site 2 has a hiking trail that leads through a forest. \r\n</p>\r\n\r\n<div class=\"img-right\">\r\n<figure>\r\n<img src=\"assets/images/laos22.JPG\" alt=\"Pha That Luang\">\r\n<figcaption>View of Pha That Luang</figcaption>\r\n</figure>\r\n</div>\r\n\r\n<div class=\"body-title\">\r\n<h1>Pha That Luang Temple</h1>\r\n</div>\r\n\r\n<p>\r\nPha That Luang is perhaps the most elegant-looking monument in Vientiane. The architecture is influenced by \r\nBuddhism and has several small stupas. The whole temple is painted in gold and is built on 3 levels. The levels \r\nrepresent the distance from Earth to heaven. The first level signifies the underworld, second level is the 30 \r\nperfections of Buddhism, and third level is the gates to heaven. Since it is a temple, tourists should be \r\nconsiderate in how they dress as to not offend the locals. It is the perfect place to just meditate or \r\nto learn about how Buddhism influenced Laos. \r\n</p>\r\n\r\n<div class=\"body-title\">\r\n<h1>Map</h1>\r\n</div>\r\n\r\n<p>\r\nAll of the cities and landmarks described on this site are shown on this map. Click on one of the \r\nflags to learn more about that place. \r\n</p>\r\n<div class=\"map\">\r\n<iframe src=\"https://www.google.com/maps/d/u/0/embed?mid=1eMHa3A9Ey1eSmqp_xXbvdnnd3VgbjyXg\" width=\"640\" height=\"480\"></iframe>\r\n</div>\r\n\r\n</div>', NULL, 'https://', ''),
