(8, 'references', '<div class=\"content\">\r\n\r\n<div class=\"body-title\">\r\n<h1>References</h1>\r\n</div>\r\n\r\n<p>All borrowed content and images are properly cited on this page. Any other information is written from my own knowledge.</p>\r\n\r\n<table>\r\n<tr>\r\n	<th>Source URL</th>\r\n	<th>Source Updated</th>\r\n	<th>Location Used on Website</th>\r\n	<th>Image</th>	\r\n</tr>\r\n\r\n<tr>\r\n	<th><a href=\"https://www.facebook.com/laossimplybeautiful.info/\">Link</a></th>\r\n	<th>2013</th>\r\n	<th>I used this logo on my homepage.</th>\r\n	<th><img src=\"assets/images/laos2.jpg\" alt=\"Slogan\"></th>\r\n</tr>\r\n\r\n<tr>\r\n	<th><a href=\"http://www.laostours.us/destinations/vientiane/patuxai-victory-monument-vientiane/\">Link</a></th>\r\n	<th>No published date</th>\r\n	<th>I used this logo on my homepage.</th>\r\n	<th><img src=\"assets/images/laos4.jpg\" alt=\"Patuxay\"></th>\r\n</tr>\r\n\r\n\r\n<tr>\r\n	<th><a href=\"https://www.cnn.com/2017/08/07/asia/mandalao-responsible-elephant-retreat-laos/index.html\">Link</a></th>\r\n	<th>August 8 2017</th>\r\n	<th>I used this logo on my homepage.</th>\r\n	<th><img src=\"assets/images/laos5.jpg\" alt=\"Elephants\"></th>\r\n</tr>\r\n\r\n<tr>\r\n	<th><a href=\"https://www.tourismlaos.org/show_province.php?Cont_ID=778\">Link</a></th>\r\n	<th>No published date</th>\r\n	<th>I used this logo on my History page.</th>\r\n	<th><img src=\"assets/images/laos6.jpg\" alt=\"Fa Ngum\"></th>\r\n</tr>\r\n\r\n<tr>\r\n	<th><a href=\"https://www.cnn.com/travel/article/vang-vieng-laos-adventure/index.html\">Link</a></th>\r\n	<th>No published date</th>\r\n	<th>I used this logo on my Regions page.</th>\r\n	<th><img src=\"assets/images/laos7.jpg\" alt=\"Si Phan Don\"></th>\r\n</tr>\r\n\r\n<tr>\r\n	<th><a href=\"http://www.visit-laos.com/luang-prabang/\">Link</a></th>\r\n	<th>No published date</th>\r\n	<th>I used this logo on my Regions page.</th>\r\n	<th><img src=\"assets/images/laos8.jpg\" alt=\"Luang Prabang View\"></th>\r\n</tr>\r\n\r\n<t